bool cmp_le(string const & a, string const & b) {
    int i = 0;
    int j = 0;
    while (i < a.size() and j < b.size()) {
        if (isdigit(a[i]) and isdigit(b[j])) {
            ll x = 0;
            ll y = 0;
            for (; i < a.size() and isdigit(a[i]); ++ i) x = 10 * x + a[i] - '0';
            for (; j < b.size() and isdigit(b[j]); ++ j) y = 10 * y + b[j] - '0';
            if (x != y) return x <= y;
        } else {
            if (a[i] != b[i]) return a[i] <= b[i];
            ++ i;
            ++ j;
        }
    }
    if (i < a.size()) return false;
    if (j < b.size()) return true;
    assert (a == b);
    return true;
}

