void parse(char s[], vpii &f) {
  f.clear();
  for (char *cpt = s; *cpt;) {
    if (*cpt >= '0' && *cpt <= '9') {
      int num = 0;
      while (*cpt >= '0' && *cpt <= '9')
	num = num * 10 + (*(cpt++) - '0');
      f.push_back(pii(NUM, num));
    }
    else
      f.push_back(pii(LTR, (int)*(cpt++)));
  }
}

bool ltvpii(const vpii &a, const vpii &b) {
  int na = a.size(), nb = b.size(), n = min(na, nb);

  for (int i = 0; i < n; i++)
    if (a[i] != b[i]) return (a[i] < b[i]);
  return (na < nb);
}

