int strcmp_sync(const char* s1, const char* s2) {
	for (; !(*s1 == '\0' && *s2 == '\0'); ++s1, ++s2) {
		if (*s1 == '\0') {
			return -1;
		}
		if (*s2 == '\0') {
			return 1;
		}
		if (isdigit(*s1) || isdigit(*s2)) {
			if (!isdigit(*s2)) {
				return -1;
			}
			if (!isdigit(*s1)) {
				return 1;
			}

			const int u1 = atoi(s1);
			const int u2 = atoi(s2);
			if (u1 < u2) {
				return -1;
			}
			if (u2 < u1) {
				return 1;
			}
		}
		else {
			if (*s1 < *s2) {
				return -1;
			}
			if (*s2 < *s1) {
				return 1;
			}
		}
	}
	return 0;
}


