S change(const string& s){
    S ret;
    string tmp;
    int n = s.size();
    int i = 0;
    while(i < n) {
        if(tmp.empty()) tmp += s[i++];
        else if(isNum(tmp.back()) ^ isNum(s[i])) {
            ret.pb(tmp);
            tmp.clear();
        }
        else {
            tmp += s[i++];
        }
    }
    if(!tmp.empty()) ret.pb(tmp);
    return ret;
}

bool cmp(const string& s, const string& t) {
    auto x = change(s), y = change(t);
    int n = x.size();
    rep(i, n) {
        if(y.size() <= i) {
            LINE;
            return false;
        }
        auto& s = x[i];
        auto& t = y[i];
        if(s == t) continue;
        if(isNum(s[0])) {
            if(isNum(t[0])) {
                if(s.size() != t.size()) {
                    LINE;
                    return s.size() < t.size();
                }
                rep(j, s.size()) if(s[j] != t[j]) {
                    LINE;
                    return s[j] < t[j];
                }
            }
            else {
                LINE;
                return true;
            }
        }
        else if(isNum(t[0])) {
            LINE;
            return false;
        }
        else {
            LINE;
            return s < t;
        }
    }
    if(x.size() < y.size()) {
        LINE;
        return true;
    }
    LINE;
    return false;
}

