using namespace std;

class Item {
public:
    string s;

    bool isNum() const {
        return s[0] <= '9' && s[0] >= '0';
    }

    bool operator<(const Item &x) const {
        if (isNum() && x.isNum()) return atoi(s.c_str()) < atoi(x.s.c_str());
        if (isNum()) return true;
        if (x.isNum()) return false;
        return s < x.s;
    }

};

bool isNum(char c) {
    return c >= '0' && c <= '9';
}

vector<Item> conv(string s) {
    if (s.size() == 0) return {};
    vector<Item> res;
    for (int i = 0; i < s.size(); i++) {
        if (isNum(s[i]) != isNum(s[0])) {
            res.push_back(Item{s.substr(0, i)});
            auto tmp = conv(s.substr(i));
            res.insert(res.end(), tmp.begin(), tmp.end());
            return res;
        }
    }
    res.push_back({s});
    return res;

}

