    int n;
    cin >> n;
    string s0;
    cin >> s0;
    for (int i = 0; i < n; i++) {
        string s;
        cin >> s;
        if (conv(s) < conv(s0)) {
            cout << "-";
        } else {
            cout << "+";
        }
        cout << endl;
    }
}

