struct X {
  int v;
  string str;
};

bool operator<(const X& a, const X& b) {
  if (a.v == 0) {
    if (b.v == 0) {
      return a.str < b.str;
    }
    return false;
  } else if (b.v == 0) {
    return true;
  }
  return a.v < b.v;
}

vector<X> parse(const string& s) {
  vector<X> r;
  int v = 0;
  string str;
  for (char c : s) {
    if ('0' <= c && c <= '9') {
      if (!str.empty()) {
        r.emplace_back(X{v, str});
        str = "";
      }
      v = v * 10 + c - '0';
    } else {
      if (v != 0) {
        r.emplace_back(X{v, str});
        v = 0;
      }
      str.push_back(c);
    }
  }
  r.emplace_back(X{v, str});
  return r;
}

