string base;
string str;
int n;

bool isNumber( char a ) {
    return a >= '0' && a <= '9';
}

int judge( string& num1, string& num2 ) {
    if( num1.size() != num2.size() ) {
        return num1.size() - num2.size();
    }
    for( int i = 0; i < num1.size(); ++i ) {
        if( num1[i] != num2[i] ) {
            return num1[i] - num2[i];
        }
    }
    return 0;
}

bool judge() {
    int i = 0, j = 0;
    while( i < base.size() && j < str.size() ) {
        if( isNumber(base[i]) && isNumber(str[i]) ) {
            string num1 = "";
            while( i < base.size() && isNumber(base[i]) ) {
                num1 += base[i];
                ++i;
            }
            string num2 = "";
            while( j < str.size() && isNumber(str[j]) ) {
                num2 += str[j];
                ++j;
            }
            int res = judge(num1,num2);
            if( res < 0 ) {
                return true;
            } else if( res > 0 ) {
                return false;
            }
        } else if( isNumber(base[i]) ) {
            return true;
        } else if( isNumber(str[j]) ) {
            return false;
        } else if( base[i] == str[j] ) {
            ++i, ++j;
        } else {
            return base[i] < str[j];
        }
    }
    if( i != base.size() ) {
        return false;
    }
    return true;
}

int main() {
    cin>>n;
    cin>>base;
    while( n-- ) {
        cin>>str;
        if( judge() ) {
            cout<<"+"<<endl;
        } else {
            cout<<"-"<<endl;
        }
    }

    return 0;
}

