string a, b;
int n;
bool isnumber(char a)
{
	if(a >= '0' && a <= '9') return true;
	return false;
}
bool cmp(string a, string b)	// b < a is -, return false; b > a is +, return true;
{
	int len1 = a.length(), len2 = b.length();
	int sum1 = 0, sum2 = 0;
	for(int i = 0; i < len1 &&  i < len2; i++)
	{
		if(a[i] < b[i] && !sum1 && !sum2 && (!isnumber(a[i]) || !isnumber(b[i]))) return true;
		if(a[i] > b[i] && !sum1 && !sum2 && (!isnumber(a[i]) || !isnumber(b[i]))) return false;

		if(isnumber(a[i]) && isnumber(b[i]))
		{
			int tmp = i;
			while(tmp < len1 && isnumber(a[tmp])) 
			{
				sum1 = sum1 * 10 + (a[tmp] - '0');
				++tmp;
			}
			int tmp2 = i;
			while(tmp2 < len2 && isnumber(b[tmp2]))
			{
				sum2 = sum2 * 10 + (b[tmp2] - '0');
				++tmp2;
			}
			if(sum1 > sum2) return false;
			if(sum1 < sum2) return true;
			sum1 = sum2 = 0;
			int mx = max(tmp, tmp2);
			i = mx - 1;
			if(mx == len1 || mx == len2) break;

		}
	}
	if(sum1 != sum2)
	{
		int mlen = min(len1, len2);
		if(mlen == len1 && mlen == len2)
			return sum1 < sum2;
		int i = mlen + 1;
		if(i < len1 && isnumber(a[i]))
			return false;
		if(i < len2 && isnumber(b[i]))
			return true;
	}
	return len1 <= len2;
}
