vector<pair<string, int>> decode(string &s) {
    vector<pair<string, int>> res;
    int p = 0;
    while (p < s.size()) {
        if (isdigit(s[p])) {
            int num = 0;
            while (p < s.size() && isdigit(s[p])) num = num * 10 + s[p++] - '0';
