vector<int> toNumArray(string s) {
    int i, j;
    vector<int> ret;
    int GETA = 1e+9;

    for (i = 0; i < s.length(); ) {
        if ('0' <= s[i] && s[i] <= '9') {
            int num = 0;
            for (j = i; j < s.length(); j++) {
                if (!('0' <= s[j] && s[j] <= '9')) {
                    break;
                }
                //s[j]は数字'0'～'9'
                num *= 10;
                num += s[j] - '0';
            }
            ret.push_back(num);
            i = j;
        }
        else {
            ret.push_back(s[i] + GETA);
            i++;
        }
    }
    return ret;
}

bool before(string key, string base) {
    vector<int> a = toNumArray(key);
    vector<int> b = toNumArray(base);
    int loopCnt = min(a.size(), b.size());
    int i;

    for (i = 0; i < loopCnt; i++) {
        if (a[i] != b[i]) {
            if (a[i] < b[i]) {
                return true;
            }
            else {
                return false;
            }
        }
    }
    if (a.size() < b.size()) {
        return true;
    }
    if (a.size() > b.size()) {
        return false;
    }
    //key == base (otherwise ~ +)
    return false;
}

