vector<pair<string,int> > decode(string str) {
	vector<pair<string, int> > res;
    int num = 0;
	string tmp = "";
    for (auto c : str) {
		if (c >= '0' && c <= '9') {
			num *= 10, num += c - '0';
		}
		else {
			if (num != 0) {
				res.push_back({ tmp, num });
				tmp = "";
				num = 0;
			}
			tmp += c;
		}
    }
	if (tmp != "" || num != 0) res.push_back({ tmp, num });
	return res;
}

