using namespace std;

vector<string> split(string s) {
  string t = "";
  rep(i,(int)s.size()) {
    t += s[i];
    if( !( i + 1 < (int)s.size() && isdigit(s[i]) && isdigit(s[i+1]) ) ) t += " ";

  }
  stringstream ss(t);
  vector<string> vec;
  while( ss >> t ) vec.push_back(t);
  return vec;
}

char check(vector<string> vs, vector<string> vt) {
  int n = min(vs.size(),vt.size());
  rep(i,n) {
    if( isdigit(vs[i][0]) && isdigit(vt[i][0]) ) {
      long long is = atoll(vs[i].c_str());
      long long it = atoll(vt[i].c_str());
      if( is != it ) return ( is < it ) ? '+' : '-';
    } else if( isdigit(vs[i][0]) || isdigit(vt[i][0]) ) {
      return isdigit(vs[i][0]) ? '+' : '-';
    } else {
      if( vs[i] != vt[i] ) return ( vs[i] < vt[i] ) ? '+' : '-';
    }
  }
  if( vs.size() <= vt.size() ) return '+';
  return '-';
}

int main() {
  int n;
  cin >> n;
  string s,t;
  cin >> s;
  vector<string> vs = split(s);
  rep(i,n) {
    cin >> t;
    cout << check(vs,split(t)) << endl;
  }
  return 0;
}

