            ret += c;
        } else {
            break;
        }
    }
    return ret;
}

bool is_num(char c) {
    return '0' <= c && c <= '9';
}

bool comp(const string& s, const string& t) {
    if (s.empty()) return true;
    if (t.empty()) return false;
    if (is_num(s.front()) && is_num(t.front())) {
        int sp = stoi(get_prefix_num(s));
        int tp = stoi(get_prefix_num(t));
        if (sp == tp) {
            int l = get_prefix_num(s).size();
            return comp(s.substr(l), t.substr(l));
        }
        return sp < tp;
    } else if (is_num(s.front())) {
        return true;
    } else if (is_num(t.front())) {
        return false;
    } else {
        string sp = get_prefix_chs(s);
        string tp = get_prefix_chs(t);
        if (sp == tp) {
            int l = sp.size();
            return comp(s.substr(l), t.substr(l));
        }
        return sp < tp;
    }
}

