#define greater "+"
#define lesser "-"
string solve(string a, string b) {
    int na = a.length();
    int nb = b.length();

    int n = min(na, nb);
    rep(i, 0, n) {
        if (isNum(a[i]) and !isNum(b[i])) return greater;
        if (!isNum(a[i]) and isNum(b[i])) return lesser;
        if (!isNum(a[i]) and !isNum(b[i])) {
            if (a[i] == b[i]) continue;
            if (a[i] < b[i]) return greater;
            return lesser;
        }

        if (isNum(a[i]) and isNum(b[i])) {
            int cnta = 0, ida = i;
            while (ida < na and isNum(a[ida])) cnta++, ida++;

            int cntb = 0, idb = i;
            while (idb < nb and isNum(b[idb])) cntb++, idb++;

            if (cnta < cntb) return greater;
            if (cnta > cntb) return lesser;

            rep(j, i, i + cnta) {
                if (a[j] == b[j]) continue;
                if (a[j] < b[j]) return greater;
                return lesser;
            }

            i += cnta - 1;
        }
    }

    if (na == nb) return greater;
    if (na < nb) return greater;
    return lesser;
}
