def tl(s):
	pre = False
	ref = []
	for i in s:
		if ord(i) < 58:
			if pre:
				ref[-1] = [True, ref[-1][1]*10 + int(i)]
			else:
				pre = True
				ref += [[True, int(i)]]
		else:
			ref += [[False, i]]
			pre=False
	return ref

