def convert(s):
    l = []
    for i in range(len(s)):
        if s[i].isdigit():
            if len(l) != 0 and isinstance(l[-1], list):
                l[-1].append(s[i])
            else:
                l.append([s[i]])
        else:
            l.append(s[i])

    return [int(''.join(e)) if isinstance(e, list) else e for e in l]

