def solve(A, B):
    i = 0
    j = 0
    N = len(A)
    M = len(B)
    while i < N and j < M:
        c = A[i]
        d = B[i]
        if '0' <= c <= '9':
            if '0' <= d <= '9':
                ii = i + 1
                while ii < N and '0' <= A[ii] <= '9':
                    ii += 1
                jj = j + 1
                while jj < M and '0' <= B[jj] <= '9':
                    jj += 1
                a = int(A[i : ii])
                b = int(B[j : jj])
                if a != b:
                    return a - b
                i = ii
                j = jj
            else:
                return -1
        else:
            if '0' <= d <= '9':
                return 1
            if c != d:
                return ord(c) - ord(d)
            i += 1
            j += 1

    if i < N:
        return 1
    if j < M:
        return -1
    return 0


